void
rc4_keysetup(struct rc4_ctx *ctx, u_char *key, u_int32_t klen)
{
 u_int8_t x, y;
 u_int32_t i;

 x = y = 0;
 for (i = 0; i < 256; i++)
  ctx->state[i] = i;
 for (i = 0; i < 256; i++) {
  y = (key[x] + ctx->state[i] + y) % 256;
  do { u_int8_t t = ctx->state[i]; ctx->state[i] = ctx->state[y]; ctx->state[y] = t; } while(0);
  x = (x + 1) % klen;
 }
 ctx->x = ctx->y = 0;
}

void
rc4_crypt(struct rc4_ctx *ctx, u_char *src, u_char *dst,
    u_int32_t len)
{
 u_int32_t i;

 for (i = 0; i < len; i++) {
  ctx->x = (ctx->x + 1) % 256;
  ctx->y = (ctx->state[ctx->x] + ctx->y) % 256;
  do { u_int8_t t = ctx->state[ctx->x]; ctx->state[ctx->x] = ctx->state[ctx->y]; ctx->state[ctx->y] = t; } while(0);
  dst[i] = src[i] ^ ctx->state[
     (ctx->state[ctx->x] + ctx->state[ctx->y]) % 256];
 }
}

